--< Booting Library >--
local Library = loadstring(game:HttpGet("https://raw.githubusercontent.com/Cerbiale/TMR-Hub/main/TMRHub-Library.lua"))()

local Window = Library:Window("TMR-Hub [V2]","",Enum.KeyCode.RightControl);

local Tab1 = Window:Tab("Main", "")
local Tab2 = Window:Tab("Space/Desert", "")
local Tab3 = Window:Tab("Pets", "")
local Tab4 = Window:Tab("Evolve", "")
local Tab5 = Window:Tab("Crystals", "")
local Tab6 = Window:Tab("Slow Glitch", "")
local Tab7 = Window:Tab("Fast Glitch", "")
local Tab8 = Window:Tab("Rebirths", "")
local Tab9 = Window:Tab("Teleports", "")
local Tab10 = Window:Tab("Settings", "")

Tab1:Seperator("Universal")
Tab1:Toggle("Auto Race",false,false,false,function(state) 
 if state then 
             _G.AR = true 
         else 
             _G.AR = false 
         end 
 end) 
 Tab1:Toggle("Auto Rebirth",false,false,false,function(state) 
 if state then 
            _G.loop = true 
            while _G.loop == true do wait() 
                game:GetService("ReplicatedStorage").rEvents.rebirthEvent:FireServer("rebirthRequest") 
            end 
         else 
            _G.loop = false 
         end 
 end) 
 Tab1:Toggle("Auto Hoops V1",false,false,false,function(state) 
 if state then 
            _G.loop = true 
            while _G.loop == true do wait() 
                for i,v in pairs(game:GetService("Workspace").Hoops:GetChildren()) do 
                                 firetouchinterest(v, game:GetService('Players').LocalPlayer.Character.HumanoidRootPart, 0) 
                                 wait() 
                                 firetouchinterest(v, game:GetService('Players').LocalPlayer.Character.HumanoidRootPart, 1) 
                                 end 
            end 
         else 
            _G.loop = false 
         end 
 end) 
 Tab1:Toggle("Auto Hoops V2",false,false,false,function(state) 
 if state then 
            _G.loop = true 
            while _G.loop == true do wait() 
               local children = workspace.Hoops:GetChildren() 
                     for i, child in ipairs(children) do 
                         if child.Name == "Hoop" then 
                         child.CFrame = game.Players.LocalPlayer.Character.HumanoidRootPart.CFrame 
                     end     
                 end  
            end 
         else 
            _G.loop = false 
         end 
 end) 
 Tab1:Button("Enable Trades",function() 
 local args = { 
  
     [1] = "enableTrading" 
  
 } 
  
 game:GetService("ReplicatedStorage"):WaitForChild("rEvents"):WaitForChild("tradingEvent"):FireServer(unpack(args)) 
  
 end) 
 Tab1:Button("Disable Trades",function() 
 local args = { 
  
     [1] = "disableTrading" 
  
 } 
  
 game:GetService("ReplicatedStorage"):WaitForChild("rEvents"):WaitForChild("tradingEvent"):FireServer(unpack(args)) 
  
 end) 
 Tab1:Line()
